                                <Link to="/Cart" class="nav-link" >ShoppingCart</Link>

                            </li>

                        </ul>
                        <form class="d-flex" role="search">
                            <input class="form-control me-2" value={filter} onChange={SearchText.bind} type="search" placeholder="Search" aria-label="Search" />
                            <button class="btn btn-outline-success" type="submit">Search</button>
                        </form>
                    </div>
                </div>
            </nav>
            </div>
        </>
    );
}

export default Navbar;
